import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
   faArrowRight,
   faArrowLeft,
} from '@fortawesome/free-solid-svg-icons';

import Button from 'components/commons/Button/Button';

import styles from './GarageTable.module.scss';

function GarageTable() {

   return(
      <div className = { styles.garageTable }>

         <div className = { styles.track }>

         </div>
         <div className = { styles.tableFooter }>
            <Button name = { <span><FontAwesomeIcon icon = { faArrowLeft } /> Previous Page</span> }/>
            <p>Page No13</p>
            <Button name = { <span>Next Page <FontAwesomeIcon icon = { faArrowRight } /></span> }/>
         </div>
      </div>
   )
}

export default GarageTable;
